// SPDX-License-Identifier: MIT



import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "hardhat/console.sol";

// FairLaunch is a smart contract for distributing ALPACA by asking user to stake the ERC20-based token.
contract FairLaunchMock {
    using SafeERC20 for IERC20;

    function deposit(
        address,
        uint256,
        uint256 _amount
    ) external {
        IERC20(0x959922bE3CAee4b8Cd9a407cc3ac1C251C2007B1).safeTransferFrom(msg.sender, address(this), _amount);
    }

    // Withdraw Staking tokens from FairLaunchToken.
    function withdraw(
        address _for,
        uint256 _pid,
        uint256 _amount
    ) external {
        _withdraw(_for, _pid, _amount);
    }

    function _withdraw(
        address,
        uint256,
        uint256 _amount
    ) internal {
        IERC20(0x959922bE3CAee4b8Cd9a407cc3ac1C251C2007B1).safeTransfer(address(msg.sender), _amount);
    }

    // Harvest ALPACAs earn from the pool.
    function harvest(uint256) external {
        IERC20(0x9fE46736679d2D9a65F0992F2272dE9f3c7fa6e0).safeTransfer(address(msg.sender), 500);
    }
}
